import React from "react";
import RecipeCard from "./RecipeCard"


const Recipe = ({recipes}) => {
  const showRecipes = () => recipes.map(recipe => <RecipeCard key={recipe.label} recipe={recipe.recipe} />)
  console.log(recipes)
  return (
    <ul className="recipe-list">
     {showRecipes()}
    </ul>
  );
};

export default Recipe;
